import React from 'react';
import IconHTML from '../img/icons/icon0.png';
import IconCSS from '../img/icons/icon1.png';
import IconBS from '../img/icons/icon2.png';
import IconJS from '../img/icons/icon3.png';
import IconREACT from '../img/icons/icon4.png';
import IconSASS from '../img/icons/icon5.png';
import IconGIT from '../img/icons/icon6.png';
import IconUI from '../img/icons/icon7.png';
import IconPS from '../img/icons/icon8.png';
import IconIL from '../img/icons/icon9.png';
import Icon3D from '../img/icons/icon10.png';
import IconNotion from '../img/icons/icon11.png';
import IconTrello from '../img/icons/icon12.png';
import IconPT from '../img/icons/icon13.png';
import IconEN from '../img/icons/icon14.png';
import './imagens.scss'


export const IconeHTML = () => {
    return  <div className='icon--section'> <img src={IconHTML} alt="HTML"></img> </div>;
  };

  
export const IconeCSS = () => {
    return  <div className='icon--section'> <img src={IconCSS} alt="CSS"></img> </div>;
  };

  
export const IconeBS = () => {
    return  <div className='icon--section'> <img src={IconBS} alt="Bootstrap"></img> </div>;
  };

  export const IconeJS = () => {
    return  <div className='icon--section'> <img src={IconJS} alt="Javascript"></img> </div>;
  };

  
export const IconeREACT = () => {
    return  <div className='icon--section'> <img src={IconREACT} alt="React.js"></img> </div>;
  };

  
export const IconeSASS = () => {
    return  <div className='icon--section'> <img src={IconSASS} alt="Sass"></img> </div>;
  };

export const IconeGIT = () => {
    return  <div className='icon--section'> <img src={IconGIT} alt="GitHub"></img> </div>;
  };

export const IconeUI = () => {
    return  <div className='icon--section'> <img src={IconUI} alt="UX/UI"></img> </div>;
  };  

export const IconePS = () => {
    return  <div className='icon--section'> <img src={IconPS} alt="Photoshop"></img> </div>;
  };


export const IconeIL = () => {
    return  <div className='icon--section'><img src={IconIL} alt="Illustrator"></img> </div>;
  };
  
export const Icone3D = () => {
    return  <div className='icon--section'> <img src={Icon3D} alt="3D"></img> </div>;
  };  

export const IconeNO = () => {
    return  <div className='icon--section'> <img src={IconNotion} alt="Notion"></img> </div>;
  };  

export const IconeTRE = () => {
    return  <div className='icon--section'> <img src={IconTrello} alt="Trello"></img> </div>;
  };  

export const IconePT = () => {
    return  <div className='icon--section'> <img src={IconPT} alt="Português"></img> </div>;
  };  
  export const IconeEN = () => {
    return  <div className='icon--section'> <img src={IconEN} alt="Inglês"></img> </div>;
  };
